import Link from "next/link";
import { MenuItem } from "./MenuItem";
import "./navbar.scss";
import { LawIcon, MenuIcon, CloseIcon } from "../../styles/icons.js";
import { useState } from "react";
const Navbar = () => {
  const [isMenuShown, setIsMenuShown] = useState(true);
  return (
    <nav className="navbarItems">
      <h1 className="navbarLogo">
        {"Önder Hukuk"}
        <LawIcon />
      </h1>
      <div className="menuIcon">
        {!isMenuShown && <CloseIcon onisMenuShown={setIsMenuShown(false)} />}
        {isMenuShown && <MenuIcon />}
      </div>
      <ul className={isMenuShown ? "navMenu active" : "navMenu "}>
        {MenuItem.map((item, index) => {
          return (
            <li key={index}>
              <Link href={item.page}>
                <a className={item.className}>{item.title}</a>
              </Link>
            </li>
          );
        })}
      </ul>
    </nav>
  );
};
export default Navbar;
